const salt = genSaltSync(10); // config\n    const hash = hashSync(plainPassword, salt); // hash\n    return hash;\n  };\n\n  async create(userDto: CreateUserDto, @UserReq() userReq: IUser) {\n    const { name, email, password, age, gender, address, role, company } =\n      userDto;\n\n    // logic check mail\n    const isExist = await this.userModel.findOne({ email });\n    if (isExist) {\n      throw new BadRequestException(\n        `Email ${email}  tn ti. Vui lng s dng email khc`,\n      );\n    }\n\n    // hash\n    const hashPassword = this.getHashPassword(userDto.password);\n\n    // create\n    let newUser = await this.userModel.create({\n      name,\n      email,\n      password: hashPassword,\n      age,\n      gender,\n      address,\n      role,\n      company,\n      createdBy: {\n        _id: userReq._id,\n        email: userReq.email,\n      },\n    });\n\n    return newUser;\n  }\n\n  async register(userDto: RegisterUserDto) {\n    const { name, email, password, age, gender, address } = userDto;\n\n    // add logic check existing mail\n    const isExist = await this.userModel.findOne({ email });\n    if (isExist) {\n      throw new BadRequestException(\n        `Email ${email}  tn ti. Vui lng s dng email khc`,\n      );\n    }\n\n    // fetch USER_ROLE role\n    const userRole = await this.roleModel.findOne({ name: USER_ROLE });\n\n    // hash password\n    const hashPassword = this.getHashPassword(password);\n\n    // do\n    let userRegister = await this.userModel.create({\n      name,\n      email,\n      password: hashPassword,\n      age,\n      gender,\n      address,\n      role: userRole?._id,\n    });\n\n    return userRegister;\n  }\n\n  async findAll(currentPage: number, limit: number, qs: string) {\n    const { filter, sort, population } = aqp(qs);\n    delete filter.current;\n    delete filter.pageSize;\n    // regular expression:\n    // - filter ca th vin s bin thnh qs ca mongoDB\n    // - VD: /pattern/i :: LIKE operator on mongoose\n\n    let offset = (+currentPage - 1) * +limit;\n    let defaultLimit = +limit ? +limit : 10;\n\n    // count all documents theo iu kin filter\n    // chia v lm trn ra tng s trang\n    const totalItems = (await this.userModel.find(filter)).length;\n    const totalPages = Math.ceil(totalItems / defaultLimit);\n\n    const result = await this.userModel\n      .find(filter)\n      .skip(offset)\n      .limit(defaultLimit)\n      .sort(sort as any)\n      .select('-password')\n      .populate(population)\n      .exec();\n\n    return {\n      meta: {\n        current: currentPage, //trang hin ti\n        pageSize: limit, //s lng bn ghi  ly\n        pages: totalPages, //tng s trang vi iu kin query\n        total: totalItems, // tng s phn t (s bn ghi)\n      },\n      result, //kt qu query\n    };\n  }\n\n  async findOne(id: string) {\n    if (!mongoose.Types.ObjectId.isValid(id)) {\n      return 'Not found user';\n    }\n\n    return await this.userModel\n      .findOne({\n        _id: id,\n      })\n      .select('-password')\n      .populate({ path: 'role', select: { name: 1, _id: 1 } });\n    // -password :: exclude >('ADMIN_EMAIL');\n    const foundUser = await this.userModel.findById(id);\n    if (foundUser.email === adminEmail) {\n      throw new BadRequestException(`Khng th xa email admin=${adminEmail}`);\n    }\n\n    // updateOne( detetedBy ) + softDelete\n    await this.userModel.updateOne(\n      { _id: id },\n      {\n        deletedBy: {\n          _id: userReq._id,\n          email: userReq.email,\n        },\n      },\n    );\n    return this.userModel.softDelete({ _id: id });\n  }\n\n  updateUserToken = async (refreshToken: string, _id: string) => {\n    await this.userModel.updateOne({ _id }, { refreshToken });\n  };\n\n  findUserByToken = async (refreshToken: string) => {\n    return await this.userModel\n      .findOne({ refreshToken })\n      .populate({ path: 'role', select: { name: 1 } });\n  };\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n             